import React from 'react';

const AppointmentsByDate = ({appointment}) => {
    console.log(appointment);
    console.log(appointment);
    return (
        <div>
            <p>This is appointment: {appointment.length}</p>
        </div>
    );
};

export default AppointmentsByDate;
